  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0089658 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR0905 in the
  Arafura Sea, Bismarck Sea and others from 2009-07-01 to 2009-07-16. These data include
  CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
  (V). The instruments used to collect these data include ADCP and GPS. These data
  were collected by SCRIPPS INSTITUTION OF OCEANOGRAPHY as part of Transit. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program. The ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
